  true,\n\t\"url\": null,\n\t\"notes\": \"Contains the sample data from Census 2000,
  which is the information compiled from the questions asked of a sample of all people
  and housing units.  The sample data are presented in 213 population tables (matrices)
  and 110 housing tables.  Each table is iterated for 336 population groups: the total
  population, 132 race groups, 78 American Indian and Alaska Native tribe categories
  (reflecting 39 individual tribes), 39 Hispanic or Latino groups, and 86 ancestry
  groups.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
